            password: DTOProfesor.password,
            estado: DTOProfesor.estado,
            coordinador: DTOProfesor.coordinador,
            rol: DTOProfesor.rol,
        })
        p.save();
        res.status(200).json(p);
      } catch (error) {
        res.status(500).json(error);
    }
};

